        const autoFill = {
            product: items.product,
            mrp: items.mrp,
            qt: items.qt,
            rate: items.rate,
            gst: items.gst,
            hsnno: items.hssno
        }
    }
    return (
        <div>
            <p onClick={()=>selectItem(items)}>{items.product}</p>
        </div>
    )
}

export default SearchItem
